function functionScrollValidation() {
    let actionName = location.pathname;
    let header = document.querySelector('.header');
    if ( actionName === "/") {
        header.setAttribute('style','position: fixed;');
        indexOnScroll();
    } else {
        header.setAttribute('style','position: absolute;');
    }
    
}
functionScrollValidation();

function indexOnScroll(){
    let width = screen.width;
    let principal = document.querySelector('.at_aturiano_slide');
    let mision = document.querySelector('#mision');
    let vision = document.querySelector('#vision');
    let clients = document.querySelector('.section_clients');
    let phrase = document.querySelector('.section_phrase');
    let map = document.querySelector('.section_map');
    let web = document.querySelector('.section_web');
    let contact = document.querySelector('.section_contact');
    let app = document.querySelector('.section_app');
    let bot = document.querySelector('.section_bot');
    let blog = document.querySelector('.section_blog');
    let nave = document.querySelector('.cohete');
    let propulsor = document.querySelector('.propulsor');

    window.onscroll = (e)=>{
        let part1 = principal.clientHeight + mision.clientHeight;
        let part2 = part1 + vision.clientHeight;
        let part3 = part2 + clients.clientHeight;
        let part4 = part3 + phrase.clientHeight;
        let part5 = part4 + map.clientHeight;
        let part6 = part5 + web.clientHeight;
        let part7 = part6 + contact.clientHeight;
        let part8 = part7 + app.clientHeight;
        let part9 = part8 + bot.clientHeight;

        let scroll = window.pageYOffset || document.documentElement.scrollTop || document.body.scrollTop || 0;
        
        if (width >= 800) {
            if(scroll>=0 && scroll<=(part1-200)){
                (nave).style.transform = 'rotate(0deg) translateY(0px)';
                (propulsor).style.opacity = 1;
            } else if(scroll>=(part1-200) && scroll<=(part2)){
                (nave).style.transform = 'rotate(180deg) translateY(-150px)';
                setTimeout(() => {
                    (propulsor).style.opacity = 0;
                }, 400);
            }
            
        } 
    }
}

